    onRemoveTransaction:()=>void
}

export function Dashboard({onCreatedTransaction}:DashboardProps){
    return(
    <Container>
        <Summary/>
        <TransactionsTable onCreatedTransaction={onCreatedTransaction}/>
    </Container>
    );
};
